import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Homepage from "./components/Homepage";
import UserLayout from "./components/User/UserLayout";
import AdminLayout from "./components/Admin/AdminLayout";
import Dashboard from "./components/User/Dashboard";
import Calendar from "./components/User/Calendar";
import Notifications from "./components/User/Notifications";
import LogCommunication from "./components/User/LogCommunication";
import FrequencyReport from "./components/Reporting/FrequencyReport"; // Update path to Reporting module
import OverdueTrends from "./components/Reporting/OverdueTrends"; // Update path to Reporting module
import EngagementEffectiveness from "./components/Reporting/EngagementEffectiveness"; // New import
import ActivityLog from "./components/Reporting/ActivityLog"; // New import
import CompanyList from "./components/Admin/CompanyList";
import CommunicationMethod from "./components/Admin/CommunicationMethod";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/user" element={<UserLayout />}>
          <Route path="dashboard" element={<Dashboard />} />
          <Route path="calendar" element={<Calendar />} />
          <Route path="notifications" element={<Notifications />} />
          <Route path="log-communication" element={<LogCommunication />} />
          <Route path="reports/frequency" element={<FrequencyReport />} />
          <Route path="reports/overdue-trends" element={<OverdueTrends />} />
        </Route>
        <Route path="/admin" element={<AdminLayout />}>
          <Route path="company-list" element={<CompanyList />} />
          <Route
            path="communication-method"
            element={<CommunicationMethod />}
          />
        </Route>
        {/* Add Report Module routes */}
        <Route path="/reports" element={<FrequencyReport />} />{" "}
        {/* Default report */}
        <Route path="/reports/frequency" element={<FrequencyReport />} />
        <Route path="/reports/overdue-trends" element={<OverdueTrends />} />
        <Route
          path="/reports/effectiveness"
          element={<EngagementEffectiveness />}
        />
        <Route path="/reports/activity-log" element={<ActivityLog />} />
      </Routes>
    </Router>
  );
};

export default App;
